■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>温感作用で毛穴の汚れスッキリ。とろけるクレンジングバーム♪</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5336/1023706-01.jpg" width="600" height="604"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#999999"><tr><td bgcolor="#FFFFCC"><table width="100%" border="0" cellpadding="3" cellspacing="0"><tr><th><font color="#FF0000">------&nbsp;ココがポイント！&nbsp;------</font></th></tr><tr><td><strong><font size="3" color="#FF9900">●クレンジング、洗顔、温感マッサージ、角質ケア、パックの5機能を1つに!!</font></strong></td></tr><tr><td><strong><font size="3" color="#FF9900">●肌の上で固形からとろけるオイルへと変化。汚れに密着し絡め取ります!!</font></strong></td></tr><tr><td><strong><font size="3" color="#FF9900">●温感作用で肌がポカポカ温まる、ホットエステ感覚♪</font></strong></td></tr><tr><td><strong><font size="3" color="#FF9900">●無香料・無着色・無鉱物油・パラベンフリーでお肌にやさしい♪</font></strong></td></tr><tr><td><strong><font size="3" color="#FF9900">●オレンジ油、ゼラニウム油の精油のリラックスできる香りです♪</font></strong></td></tr></table></td></tr></table><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【使用方法】<br>1.適量(マスカット大)を乾いた手にとり、両手を重ね合わせるようにして温め、柔らかくします。<br>2.乾いた顔全体に伸ばしメイクとなじませながら下から上に向かってやさしくマッサージしてください。<br>3.水またはぬるま湯でよく洗い流してください。W洗顔は不要です。<br><br>【ご使用上の注意】<br>・化粧品がお肌に合わない時はご使用をおやめください。<br>・傷やはれもの・湿疹等、異常のある部位にはお使いにならないでください。<br>・使用中、赤み・はれ・かゆみ・刺激等の異常があらわれた場合、または使用したお肌に直射日光があたって上記のような異常があらわれた場合は直ちに使用を中止し、皮膚科専門医などへのご相談をおすすめします。<br>・万が一、目に入った場合はすぐに洗い流してください。<br>・容器の中に水を入れないよう、ご注意ください。<br>・乳幼児の手の届かない所に保管してください。<br>・直射日光のあたる場所や、極端に高温または低温の場所には保管しないでください。</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="600" height="600" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5336/1023706-02.jpg"><br><font size="3"></font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="623" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5336/1023706-03.jpg"><br><font size="3"></font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="600" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5336/1023706-04.jpg"><br><font size="3">※中身イメージ</font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">クレンジング、洗顔、温感マッサージ、角質ケア、パックの5機能を1つに!!温感作用とディープクレンジング作用でW洗顔不要のクレンジングバームです。オリーブオイルやヒアルロン酸、コラーゲンなどの保湿成分配合。肌のうるおいを取り過ぎないので、しっとりとした洗い上がりです。</font></td></tr></table><br><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">クレンジング、洗顔、温感マッサージ、角質ケア、パックの5機能を1つに!!温感作用とディープクレンジング作用でW洗顔不要のクレンジングバームです。オリーブオイルやヒアルロン酸、コラーゲンなどの保湿成分配合。肌のうるおいを取り過ぎないので、しっとりとした洗い上がりです。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">100g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：7×8×7cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：157g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">成分</font></td><td align="left"><font color="#333333" size="-1">グリセリン、オリーブ油、パルミチン酸イソプロピル、PEG-10ヒマワリグリセリズ、ヤシ油脂肪酸PEG-7グリセリル、(ベヘン酸/エイコサン二酸)ポリグリセリル-10、(ベヘン酸/エイコサン二酸)グリセリル、ステアリン酸グリセリル(SE)、ポリエチレン、オレンジ油、ニオイテンジクアオイ油、ユーカリ葉油、ティーツリー葉油、ピーナッツ油、パルミチン酸レチノール、セラミド3、ヒアルロン酸Na、加水分解コラーゲン、ミツロウ、水、BG、ジイソステアリン酸ポリグリセリル-2、トコフェロール</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">商品区分：化粧品<br>メーカー名：(株)グルーブ</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
